import React from "react";
import "./Hero.css";
import heroImg from ".././";

function Hero() {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>Hi, I'm <span>Sawera</span></h1>
        <p>
          A passionate Frontend Developer specialized in React & modern web experiences.
        </p>
        <div className="hero-buttons">
          <a href="/resume.pdf" download className="btn primary-btn">Download Resume</a>
          <a href="/contact" className="btn secondary-btn">Contact Me</a>
        </div>
      </div>

      <div className="hero-image">
        <img src={heroImg} alt="Sawera" />
      </div>
    </section>
  );
}

export default Hero;
